import Info from "./components/Info";
import About from "./components/About";
import Intrest from "./components/Intrest";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="card">
          <Info />
          <About />
          <Intrest />
          <Footer />
        </div>
      </div>
    </div>
  );
}

export default App;
